package aeternity

import (
	"math/big"
	"reflect"
	"testing"
)

func TestNewGAAttachTx(t *testing.T) {
	type args struct {
		OwnerID      string
		AccountNonce uint64
		Code         string
		AuthFunc     []byte
		VMVersion    uint16
		AbiVersion   uint16
		Gas          big.Int
		GasPrice     big.Int
		Fee          big.Int
		TTL          uint64
		CallData     string
	}
	tests := []struct {
		name string
		args args
		want string
	}{
		{
			name: "Example from Python, VMVersion 4, ABIVersion 1",
			args: args{
				OwnerID:      "ak_oeoYuVx1wmPxSADDCY6GFVorfJHFYBKia9KonSiWjtbvNQv9Y",
				AccountNonce: 1,
				Code:         "cb_",
				AuthFunc:     []byte{96, 0, 184, 90, 183, 93, 180, 49, 139, 122, 45, 0, 88, 192, 16, 175, 167, 85, 183, 183, 4, 214, 35, 12, 90, 196, 201, 236, 49, 59, 255, 71},
				VMVersion:    4,
				AbiVersion:   1,
				Gas:          *big.NewInt(500),
				GasPrice:     *big.NewInt(1000000000),
				Fee:          *big.NewInt(126720000000000),
				TTL:          0,
				CallData:     "cb_AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACBr3oQ9kk7r4vfEo59G7V5ElA05+tiGYJ3WZV0FTSttEgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAABgae21UoMYpb0U8XZCTsTvUGUNeF/kxvl/87SxMDOBYASarBTN",
			},
			want: "tx_",
		},
		{
			name: "Same as before but different Owner",
			args: args{
				OwnerID:      "ak_2a1j2Mk9YSmC1gioUq4PWRm3bsv887MbuRVwyv4KaUGoR1eiKi",
				AccountNonce: 1,
				Code:         "cb_",
				AuthFunc:     []byte{96, 0, 184, 90, 183, 93, 180, 49, 139, 122, 45, 0, 88, 192, 16, 175, 167, 85, 183, 183, 4, 214, 35, 12, 90, 196, 201, 236, 49, 59, 255, 71},
				VMVersion:    4,
				AbiVersion:   1,
				Gas:          *big.NewInt(500),
				GasPrice:     *big.NewInt(1000000000),
				Fee:          *big.NewInt(200000000000000),
				TTL:          0,
				CallData:     "cb_AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAACBr3oQ9kk7r4vfEo59G7V5ElA05+tiGYJ3WZV0FTSttEgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAABgae21UoMYpb0U8XZCTsTvUGUNeF/kxvl/87SxMDOBYASarBTN",
			},
			want: "tx_",
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got := NewGAAttachTx(tt.args.OwnerID, tt.args.AccountNonce, tt.args.Code, tt.args.AuthFunc, tt.args.VMVersion, tt.args.AbiVersion, tt.args.Gas, tt.args.GasPrice, tt.args.Fee, tt.args.TTL, tt.args.CallData)
			gotRLP, err := SerializeTx(&got)
			if err != nil {
				t.Error(err)
			}
			if !reflect.DeepEqual(gotRLP, tt.want) {
				t.Errorf("NewGAAttachTx() = %v, want %v", got, tt.want)
			}
		})
	}
}
